  \ a new railway will increase uncontrollably. There will be a total of q occurrences\
  \ of this kind of incident, and the i-th event will add additional amount of x_i\
  \ to the cost of building a new railway from the station k_i.\n\nTo save resources,\
  \ before all incidents and after each incident, Nitori wants you to help her calculate\
  \ the minimal cost of railway construction.\n\nInput\n\nThe first line contains\
  \ three integers n, m, and q (1 \u2264 n \u2264 2 \u22C5 10^5, 1 \u2264 m \u2264\
  \ 3 \u22C5 10^5, 0 \u2264 q \u2264 2\u22C510^5).\n\nThe second line contains n integers\
  \ w_1,w_2,\u2026,w_n (1 \u2264 w_i \u2264 10^9).\n\nEach of the next m lines contains\
  \ three integers u, v, d (1 \u2264 u,v \u2264 n, u \u2260 v, 1 \u2264 d \u2264 10^9),\
  \ denoting a two-way railway connecting station u and station v, with length d.\n\
  \nThe i-th of the next q lines contains two integers k_i,x_i (1 \u2264 k_i \u2264\
  \ n, 1 \u2264 x_i \u2264 4 \xD7 10^8).\n\nOutput\n\nPrint q+1 lines, and the i-th\
  \ of these lines contains one integer, denoting the minimal cost of railway construction\
  \ after the i-1-th incident (especially, the 0-th incident means no incident occurred).\n\
  \nExamples\n\nInput\n\n\n5 5 1\n1 1 1 1 1\n1 2 1\n2 3 1\n2 4 1\n3 5 1\n4 5 1\n1\
  \ 2\n\n\nOutput\n\n\n3\n9\n\n\nInput\n\n\n8 11 0\n14 4 16 15 1 3 1 14\n4 2 1\n1\
  \ 2 3\n7 5 4\n2 3 1\n8 6 2\n8 5 5\n5 4 5\n7 6 7\n3 5 5\n1 6 6\n8 1 4\n\n\nOutput\n\
  \n\n46\n\n\nInput\n\n\n10 16 8\n29 1 75 73 51 69 24 17 1 97\n1 2 18\n2 3 254\n2\
  \ 4 546\n2 5 789\n5 6 998\n6 7 233\n7 8 433\n1 9 248\n5 10 488\n2 6 1787\n10 8 1176\n\
  3 8 2199\n4 8 1907\n2 10 1277\n4 10 731\n9 10 1047\n1 11\n1 9\n8 8\n1 3\n2 19\n\
  9 5\n9 4\n7 6\n\n\nOutput\n\n\n34\n45\n54\n54\n57\n76\n96\n112\n112\n\nNote\n\n\
  In the second example, Nitori can build railways as follows: 1 \u2192 2, 1 \u2192\
