- " ```from collections import deque\nn, m, q = map(int, input().split())\nw = list(map(int,\
  \ input().split()))\ngraph = {}\nfor _ in range(m):\n    u, v, d = map(int, input().split())\n\
  \    if u not in graph:\n        graph[u] = []\n    if v not in graph:\n       \
  \ graph[v] = []\n    graph[u].append((v, d))\n    graph[v].append((u, d))\ndp =\
  \ [[float('inf')] * (n + 1) for _ in range(n + 1)]\ndp[1][1] = 0\nfor i in range(1,\
  \ n + 1):\n    for j in range(1, n + 1):\n        if dp[i][j] != float('inf'):\n\
  \            for u, v in graph.get(i, []):\n                if dp[i][u] != float('inf')\
