  \ + w[i - 1])\nfor _ in range(q):\n    k, x = map(int, input().split())\n    for\
  \ i in range(1, n + 1):\n        dp[i][k] += x\n    for i in range(1, n + 1):\n\
  \        for j in range(1, n + 1):\n            dp[i][j] = min(dp[i][j], dp[i][k]\
  \ + dp[k][j])\n    print(min(dp[i][j] for i in range(1, n + 1) for j in range(1,\
